import React from 'react'
import styles from './NotificationCount.module.css'
import RoundWrapper from '../util/RoundWrapper'
import { useSelector } from 'react-redux'

export default function NotificationCount(props) {
    const {notice} = useSelector(state=>state);


    return (
            <RoundWrapper Func={props.Func} diameter='40px' bgcolor={props.bgcolor} color={props.color}>
                {notice.data.length}
            </RoundWrapper>
    )
}
